import React from 'react';
import { View, Image, Text, StyleSheet, TouchableOpacity } from 'react-native';

const Search = () => {
  return (
    <View style={styles.container}>
      <View style={styles.card}>
        <View style={styles.imageContainer}>
          <Image
            source={{ uri: 'https://mdbootstrap.com/img/new/blog/25.jpg' }}
            style={styles.image}
            resizeMode="cover"
          />
          <View style={styles.overlay}>
            <View style={styles.carousel}>
              {/* Carousel content */}
              {/* Content for each slide */}
            </View>
            <View style={styles.buttons}>
              <TouchableOpacity style={styles.loginButton}>
                <Text style={styles.buttonText}>Login</Text>
              </TouchableOpacity>
              <TouchableOpacity style={styles.registerButton}>
                <Text style={styles.buttonText}>Register</Text>
              </TouchableOpacity>
            </View>
          </View>
        </View>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  card: {
    width: 285,
    height: 617,
    borderRadius: 34,
    overflow: 'hidden',
  },
  imageContainer: {
    width: '100%',
    height: '100%',
    position: 'relative',
  },
  image: {
    width: '100%',
    height: '100%',
    borderRadius: 34,
  },
  overlay: {
    ...StyleSheet.absoluteFillObject,
    backgroundColor: 'rgba(67, 144, 149, 0.5)',
    borderRadius: 34,
    padding: 16,
    justifyContent: 'space-between',
  },
  carousel: {
    // Styles for carousel container
  },
  buttons: {
    // Styles for buttons container
  },
  loginButton: {
    // Styles for Login button
  },
  registerButton: {
    // Styles for Register button
  },
  buttonText: {
    // Styles for button text
  },
});

export default Search;
